const qntdModule = (html.match(/module-item-name"/g) || []).length

const data = []

let p = 0
for (let index = 0; index < qntdModule - 1; index++) {
   const moduleIndex = html.indexOf('module-item-name"', p)
   p = moduleIndex + 1
   const spanIndex =  html.indexOf('</span>', moduleIndex)
  const md = {}
   md.title = `### ${html.substring(moduleIndex + 18, spanIndex)}`
   md.content = []

   const sectionIndexInit =  html.indexOf('<section ', moduleIndex)
   const sectionIndexEnd =  html.indexOf('<section ', sectionIndexInit + 1)
   const sectionContent =  html.substring(sectionIndexInit, sectionIndexEnd)

   const qndHref = (sectionContent.match(/href=/g) || []).length

   let t = 0
   for (let index = 0; index < qndHref; index++) {
    const hrefIndexInit = sectionContent.indexOf('href=', t)
    t = hrefIndexInit + 1
    const urlIndexEnd =  sectionContent.indexOf('">', hrefIndexInit)
    
    const titleIndexInit = sectionContent.indexOf('title="', t)
    const titleIndexEnd =  sectionContent.indexOf('>', titleIndexInit)
    const title = sectionContent.substring(titleIndexInit + 7, titleIndexEnd - 1).replace('▶', '')
    const link = 'https://hotmart.com/' + sectionContent.substring(hrefIndexInit + 6, urlIndexEnd)

    md.content.push(`##### [${title}](${link})`)
   // console.log(sectionContent.substring(titleIndexInit + 6, titleIndexEnd))
   }
data.push(md)


}
